import React from 'react';

const SocialMedia = () => {
    return (
        <>
            <div class="container overflow-hidden text-center">
                <div class="row gy-1">
                    <div class="col-6">
                        <div class="p-3">Contact Us</div>
                    </div>
                    <div class="col-6">
                        <div class="p-3">About us</div>
                    </div>
                    <div class="col-6">
                        <div class="p-3">Facebook</div>
                    </div>
                    <div class="col-6">
                        <div class="p-3">Instagram</div>
                    </div>
                </div>
            </div>
        </>
    );
};

export default SocialMedia;
